import React, {ChangeEvent, Component} from "react";
import './MyName.css'


class MyName extends React.Component {

    private firstName: string
    private lastName: string

    constructor(firstName: string, lastName: string) {
        super(firstName,lastName);
        this.firstName = firstName
        this.lastName = lastName
    }

    render(): React.ReactElement<any, string | React.JSXElementConstructor<any>> | string | number | {} | React.ReactNodeArray | React.ReactPortal | boolean | null | undefined {
        return (
            <div className="MyName">
                <p className="MyName-test" id="welcome">Welcome! {document.getElementById("firstName")}</p>
                <h1 className="MyName-test">Personal Info</h1>
                <p className="MyName-title">FirstName:</p>
                <input type="text" className="MyName-input" onChange={this.getFirstName}/>
                <p className="MyName-title">Last Name:</p>
                <input type="text" className="MyName-input" id="lastName" onChange={this.getLastName}/><br/>
                <input type="submit" className="MyName-input" name="123" value="submit" on-Click="changeDate()"/>
            </div>
        )
    }

    getFirstName(e: ChangeEvent<HTMLInputElement>): void {
        this.firstName = e.target.value
    }

    getLastName(e: ChangeEvent<HTMLInputElement>): void {
        this.lastName = e.target.value
    }
}

export default MyName
